async function getPageStructure(){
  return await fetch("./pageStructure.json", {
    method: 'GET',
    headers: {
      'Content-Type': 'application/json',
      Accept: "application/json"
    }
  }).then(response => {
    return response.json();
  });
}

async function PageLoader() {
  const promise = getPageStructure();
  return await promise.then(pageStructure => {
    return (
      <div>{pageStructure["id"]}</div>
    );
  });
}

export default PageLoader;
